def run(value_list):
    """
    Calculates the ratio of total notes payable to total capital lease obligations.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the calculated ratio as a float (rounded to two decimal places)
        and the scale of the ratio ('percent').
    """
    notes_payable_total = 0
    capital_lease_total = 0

    for item in value_list:
        if item['category'] == 'Notes payable' and item['header1'] == 'Total':
            notes_payable_total = item['number_value']
        elif item['category'] == 'Capital lease obligations' and item['header1'] == 'Total':
            capital_lease_total = item['number_value']

    if capital_lease_total == 0:
        return (0.0, '')  # Avoid division by zero

    ratio = (notes_payable_total / capital_lease_total) * 100
    return (float(ratio), 'percent')

